import React from "react";
import "./App.css";
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

class Teachers extends React.Component {
  constructor(){
    super() 
      this.state = {
        teacherData: []
      }
    this.getTeacherList();
  }
  getTeacherList() {
    fetch(process.env.REACT_APP_API_URL + "/teachers")
      .then(res => res.json())
      .then(
        (result) => {
          console.log("API_URL1=>", process.env.REACT_APP_API_URL);          
          console.log("result=>", result);
          //this.setState({teacherData: result});
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    return (      
      <Paper className="MuiPaper-root-3 MuiPaper-elevation2-7 MuiPaper-rounded-4 SimpleTable-root-1">
      <div component="h2" variant="h1" gutterBottom>
        Teacher List
      </div>
      <a href="\">School List</a>
        <Table className="MuiTable-root-30 SimpleTable-table-2">
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell align="right">Country Id</TableCell>
              <TableCell align="right">region Id</TableCell>
              <TableCell align="right">School Code</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>

          </TableBody>
        </Table>
      </Paper>
    );
  }
}

export default Teachers;
